ねんどで作る工作キット！<br><br>

※ペットボトル500ml（丸型）×2本、（角型）×1本、牛乳パック1L×1本ご用意ください！<br><br>

せんすいかんのこものいれ、ボトルマリン、このキット1つで２つとも作れるよ！<br><br>

◆完成サイズ（約）：せんすいかんのこものいれ/横19×高さ12×奥行6cm<br>
ボトルマリン/横16×高さ10.5×奥行6cm<br>
◆所要時間：約360分<br>
◆セット内容：ねんど、ビーズ、デコシート、作り方説明書２枚<br>
◆用意するもの：はさみ、セロハンテープ、紙工作用接着剤、定規、ねんどベラ、ローラー、カッター、カッター―マット、ねんど板または下じき、テープのり、つまようじ、ラップ、両面テープ、水、めんぼう、しるしをつけるもの（油性ペンなど）<br><br>

※モニターによって実物のお色と若干異なる場合がございます。<style type="text/css">
