電気を使って動いたり光ったり、普通の作品ではもの足りない、もっとすごいものが作りたい！というお子様の夢を叶えるキットです。<br><br>

消しゴムのカスなどを吸い込むことができます。<br>
デコペーパーは2種類！どちらかが作れます 。<br><br>

◆出来上がりサイズ（約）：はば19×たかさ13.5×おくゆき7cm<br>
◆所要時間：約190分<br>
◆キットに入っているもの：作り方説明書2枚・デコペーパー・電池ボックス×2・電池金具×4・プラパーツ　オス・メス・ゴム管・導線・キャップ×6・スイッチ・スイッチ金具小、大・モーター<br>
◆用意するもの：ペットボトル丸型500mL×1本、単三マンガン乾電池×2・ニッパー・はさみ・定規・カッター・カッターマット・セロハンテープ・紙用工作接着剤・両面テープ・油性ペン・目打ち<br>
◆素材：PS・鉄・塩化ビニール・銅・PE・POM・PE<br>
◆加工地：日本<br><br>

※印刷の都合上、写真と現物の色が多少異なることがあります。<br>
※キット内容が写真と異なる場合があります。 <br><br>

